window.bookSummaryJSON = "<p><b>I reincarnated as the evil god of my favorite civilization.</b></p> <p>Takuto Ira succumbed to illness at a young age and ended up reincarnating in a world that resembles the fantasy turn-based strategy game <i>Eternal Nations</i>. Not only did he reincarnate into his favorite game but as the god who commands the evil civilization Mynoghra. With Mynoghra’s beautiful hero unit, Sludge Witch Atou by his side, not even legendarily difficult race traits will stand in the way of restarting their civilization!</p> <p>“Lord Takuto…won’t you start over with me?”</p> <p><b>Explore, expand, exploit, exterminate! A tactical fantasy world is waiting for heroes like you! Join </b><b><i>Eternal Nations</i></b><b> today!</b></p>"; 
